import styled from "styled-components/native";

export const Container = styled.View`
  flex: 1;
  background-color: ${({theme}) => theme.colors.background};
  align-items: center;
  flex-direction: column;
  display: flex;
`;

export const LogoImg = styled.Image`
  margin-top: 71px;
  width: 106px;
  height: 53px;
  position: absolute;
`;
